// Helper function to format numbers to German format
function formatNumberGerman(value) {
  return new Intl.NumberFormat('de-DE').format(Math.round(value));
}

const seriesData = context.panel.data.series.map((s) => {
  const categories = s.fields.find((f) => f.name === 'ageBucket').values.buffer || s.fields.find((f) => f.name === 'ageBucket').values;
  const values = s.fields.find((f) => f.type === 'number').values.buffer || s.fields.find((f) => f.type === 'number').values;

  return categories.map((category, i) => ({
    name: category,
    value: values[i],
    itemStyle: {
      color: colorMapping[category] || '#cccccc'  // Default to grey if no match
    }
  }));
})[0];  // Since it's a pie chart, we take the first series.

return {
  backgroundColor: 'transparent',
  tooltip: {
    trigger: 'item',
    formatter: (params) => {
      return `<b>${params.name}</b><br/>${formatNumberGerman(params.value)} (${formatNumberGerman(params.percent)}%)`;
