const formatNumberGerman = (number) => {
  return Math.round(number).toLocaleString('de-DE'); // Formats number to German locale
};

const FONTSIZE = 12;
const BARWIDTH = 37;

const colorMapping = {
  "male": "#1F60C4",     // Blue
  "female": "rgb(196, 22, 42)",   // Dark Red
  "unknown": "#FFD700",  // Gold
  "total": "rgb(180, 180, 180)"  // Light Grey for Gesamt
};

// Data processing based on the query results
const seriesData = context.panel.data.series.map((s) => {
  const ageBuckets = s.fields.find((f) => f.name === 'ageBucket').values.buffer || s.fields.find((f) => f.name === 'ageBucket').values;
  const totalFollowers = s.fields.find((f) => f.name === 'Gesamt').values.buffer || s.fields.find((f) => f.name === 'Gesamt').values;
  const maleFollowers = s.fields.find((f) => f.name === 'male_total_followers').values.buffer || s.fields.find((f) => f.name === 'male_total_followers').values;
  const femaleFollowers = s.fields.find((f) => f.name === 'female_total_followers').values.buffer || s.fields.find((f) => f.name === 'female_total_followers').values;
  const unknownFollowers = s.fields.find((f) => f.name === 'unknown_total_followers').values.buffer || s.fields.find((f) => f.name === 'unknown_total_followers').values;

  return ageBuckets.map((age, i) => ({
    ageBucket: age,
    male: maleFollowers[i],
    female: femaleFollowers[i],
    unknown: unknownFollowers[i],
    total: totalFollowers[i]
  }));
})[0];  // Extract the first series for simplicity

// Extracting the data for each category
const categories = seriesData.map(d => d.ageBucket);

const maleSeries = seriesData.map(d => d.male);
const femaleSeries = seriesData.map(d => d.female);
const unknownSeries = seriesData.map(d => d.unknown);
const totalSeries = seriesData.map(d => d.total);

return {
  backgroundColor: 'transparent',
  tooltip: {
    trigger: 'axis',
    axisPointer: {
      type: 'shadow'
    },
    formatter: (params) => {
      let tooltipContent = `${params[0].name}<br/>`;
      params.forEach((item) => {
        tooltipContent += `<b>${item.seriesName}:</b> ${formatNumberGerman(item.value)}<br/>`;
      });
      return tooltipContent;
    },
    textStyle: {
      fontWeight: 'bold', fontSize: FONTSIZE
    }
  },
  legend: {
    data: ['Männlich', 'Weiblich', 'Unbekannt', 'Gesamt'],
    textStyle: {
      color: 'rgba(128, 128, 128, .9)',
    },
    top: 'bottom'
  },
  toolbox: {
    feature: {
      saveAsImage: {},
    },
  },
  grid: {
    left: '3%',  // Adjust this value to move the chart more to the left
    right: '3%', // Adjust space on the right side if necessary
    top: '3%',
    bottom: '10%',
    containLabel: true
  },
  xAxis: {
    type: 'category',
    data: categories.reverse(),  // Reverse for sorting from young to old
    axisLine: {
      lineStyle: {
        color: 'rgba(128, 128, 128, .9)',
      },
    },
    axisLabel: {
      rotate: 45,  // Rotate for better readability
      show: true
    },
    axisTick: {
      show: false,  // Hide axis ticks
    }
  },
  yAxis: {
    type: 'value',
    axisLine: {
      show: false,  // Hide the y-axis line
    },
    axisLabel: {
      show: true,  // Show y-axis labels (numbers)
      formatter: function (value) {
        return value.toLocaleString('de-DE');
      }
    },
    axisTick: {
      show: false,  // Hide axis ticks
    }
  },
  series: [
    {
      name: 'Gesamt',
      type: 'bar',
      data: totalSeries.reverse(),  // Reverse to match category order
      itemStyle: {
        color: colorMapping['total'],
      },
      barWidth: BARWIDTH, // Adjust bar width if needed
      label: {
        show: true,
        position: 'top',  // Position labels at the top of bars
        formatter: (params) => formatNumberGerman(params.value),
        textStyle: {
          color: 'rgb(180, 180, 180)',
          fontWeight: 'bold', fontSize: FONTSIZE
        }
      }
    },
    {
      name: 'Männlich',
      type: 'bar',
      data: maleSeries.reverse(),  // Reverse to match category order
      itemStyle: {
        color: colorMapping['male'],
      },
      barWidth: BARWIDTH, // Adjust bar width if needed
      label: {
        show: true,
        position: 'top',  // Position labels at the top of bars
        formatter: (params) => formatNumberGerman(params.value),
        textStyle: {
          color: '#1F60C4',
          fontWeight: 'bold', fontSize: FONTSIZE,
        }
      }
    },
    {
      name: 'Weiblich',
      type: 'bar',
      data: femaleSeries.reverse(),  // Reverse to match category order
      itemStyle: {
        color: colorMapping['female'],
      },
      barWidth: BARWIDTH, // Adjust bar width if needed
      label: {
        show: true,
        position: 'top',  // Position labels at the top of bars
        formatter: (params) => formatNumberGerman(params.value),
        textStyle: {
          color: 'rgb(196, 22, 42)',
          fontWeight: 'bold', fontSize: FONTSIZE
        }
      }
    },
    {
      name: 'Unbekannt',
      type: 'bar',
      data: unknownSeries.reverse(),  // Reverse to match category order
      itemStyle: {
        color: colorMapping['unknown'],
      },
      barWidth: BARWIDTH, // Adjust bar width if needed
      label: {
        show: true,
        position: 'top',  // Position labels at the top of bars
        formatter: (params) => formatNumberGerman(params.value),
        textStyle: {
          color: '#FFD700',
          fontWeight: 'bold', fontSize: FONTSIZE
        }
      }
    }
  ]
};

